import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'
import {Link} from 'react-router-dom'

class HeaderNav extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div style={{fontFamily:"Hammersmith One", background:"blue", fontSize:"10%", width:"100%", color:'black', marginTop:"9.8vh", textAlign:"left"}}>
                <Button variant="Link" style={{color:"black"}}>
                    <Link to="/home/" style={{color:"black"}}>HOME</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/short_films/" style={{color:"black"}}>SHORT FILM</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/concept_designs/1" style={{color:"black"}}>CONCEPT DESIGN</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/illustration/1" style={{color:"black"}}>ILLUSTRATION</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/drafting/1" style={{color:"black"}}>DRAFTING</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/architectures/" style={{color:"black"}}>ARCHITECTURE</Link>
                </Button>
                <Button variant="Link" style={{color:"black"}}>
                    <Link to="/resume/" style={{color:"black"}}>RESUME</Link>
                </Button>
            </div>
        );
    }
};

export default HeaderNav;
